import "./WeatherForecast.css"

export default function WeatherForecast(){
    return (
        <div className="WeatherForecast">
            <div className="row"><div className="col"> 
            <div className="WeatherForecastDay">Thu</div>  icon <div className="WeatherForecastTemp"> <span className="maxTemp">19</span> <span className="minTemp">19</span></div></div> </div> </div>
)}
